import axios from 'axios';
import {useState, useEffect} from 'react';
//import {Link} from 'react-router-dom';

const URI = 'http://localhost:8000/Home';

const CompShowEnterprises =() =>{
    const [fuck, setEnterprise] = useState();
    useEffect(()=>{
        getEnterprises()
    }, []);

    const getEnterprises = async () =>{
        const res= await axios.get(URI);
        setEnterprise(res.data);
    }

    return(
        <div className='container'>
            <div className='row'>
                <div className='col'>
                    <table className='table'>
                        <thead className='table-primary'>
                            <tr>
                                <th>Title</th>
                                <th>Test</th>
                                <th>Fuck</th>
                            </tr>
                        </thead>
                        <tbody>
                            {
                                fuck?.map((enter)=>{
                                    return(
                                        <tr key={enter.id}>
                                            <td>{enter.nombre_empresa}</td>
                                            <td>{enter.correo}</td>
                                            <td>{enter.telefono}</td>
                                        </tr>
                                    );
                                })
                            }
                        </tbody>
                    </table>
                </div>
            </div>
        </div>
    )
}

export default CompShowEnterprises;
